Updated and detailed review👇
I’ve used these new products a few times now and have some updated thoughts…

@rhode glazing milk: still love the product, does a great job at hydrating the skin and giving a nice dewy glow but not a fan of the fragrance. It smells a bit funky

@saiebeauty glowy super gel in bronze: initially, i really didn’t think it did anything but once I saw it in the mirror up close, I could see the very subtle bronze and shine it added to my skin. I think this would be specially great for no makeup makeup days

@makeupbymario bronzing serum: I’ve been using it as a targeted bronzer and honestly will continue using it like that, I didn’t really enjoy the pump mechanism. As a bronzer itself, it gives a nice soft sunkissed look. For full makeup days, I usually go in with a cream bronzer on top because this doesn’t do the job by itself

@lysbeautyofficial foundation stick: initial impression - loved it! But I noticed that it settled into my fine lines by the end of the day. I do still enjoy the formula and prefer it over other stick foundations I’ve tried in store. But if I had to pick one, I would stick to a liquid foundation

@makeupbymario blush+bronzer set: don’t love it, don’t hate it - very ordinary products would probably not buy again. Also, the blush makes my skin feel a bit oily after a few hours of wear

@urbandecaycosmetics moondust in cosmic: loved it, totally worth the hype. It looks stunning, I was just hoping for the formula to be a bit more gel-like, similar to the Natasha Denona eyeshadows but it was still a hit for me

@kaybykatrina kohl pencil: it was fine to draw the wing but it’s so tough to make it work on my waterline, it just doesn’t show! This was probably the biggest let down in this haul

@refybeauty eyebrow gel: Like I said in the video too, I really like the product, I think it has a great hold power but it leaves white residue after a few hours if not brushed out properly. That’s a bit annoying sometimes but you just have to be extra careful

@yslbeauty loveshine in candy floss: nothing extraordinary, feels like a general lip balm but I love the mini packaging

